<!DOCTYPE html>
<html>
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <meta name="viewport" content="width=device-width,initial-scale=1">
    <script>document.title='Сайт '+location.host+' успешно размещён';</script>
    <style>
        html, body {margin:0; padding:0;}
        body {
          font-family: "Helvetica",Arial,sans-serif;
          font-size: 14pt;
          background: white;
          color: black;
          text-align: center;
          width: 960px;
          margin: 0 auto;
        }
        a {
          color: #428bca;
          text-decoration: none;
        }
        .wh1-start-header_p{
          padding: 20px;
          margin:0
        }
        .wh1-start-nav{
          max-width: 320px;
          float: left;
          margin-left: 100px;
        }
        .wh1-start-nav_button{
          display: block;
          background: #ffb700;
          color: #fff;
          text-decoration: none;
          margin: 20px;
          padding: 7px 9px;
          font-size: 15px;
          text-transform: uppercase;
          font-weight: 600;
          letter-spacing: .01em;
        }
        .wh1-start-footer_icons{
          background-color:#B4B4B4;
          padding:2px;
          margin:2px;
        }

        @media  (max-width: 979px){
          body {
            font-size: 18pt;
            width: 100%;
          }
          .wh1-start-nav{
            max-width: 100%;
            float: none;
            margin: 0 20px;
          }
        }

@supports (display: grid) {
           .wh1-start-main{
             min-height: 100vh;
             display: grid;
             grid-template-rows: auto 1fr auto;
             grid-template-columns: 1fr 2fr;
             grid-template-areas: "header header"
                                  "nav content"
                                  "footer footer";
           }
           .wh1-start-header{
             grid-area: header;
           }
           .wh1-start-nav{
             grid-area: nav;
             float: none;
           }
           .wh1-start-content{
             grid-area: content;
           }
           .wh1-start-footer{
             grid-area: footer;
           }
           @media  (max-width: 979px){
             .wh1-start-main{
               grid-template-rows: auto auto 1fr auto;
               grid-template-columns: 1fr;
               grid-template-areas: "header "
                                    "nav"
                                    "content"
                                    "footer";
                                  }
         }
}
    </style>
</head>
